import React, { useEffect, useState } from "react";

function Editor(props) {
  return (
    <div>
      <input
        id="grayscale"
        type="range"
        min="0"
        max="1"
        steps="0.01"
        data-unit=""
        value={props.grayscale}
        onChange={(e) => {
          props.updateGrayscale(e.target.value);
        }}
      />
    </div>
  );
}

export default Editor;
